function getColor(CATEGORIA) {
    switch (CATEGORIA) {
        case 'NACIONAL':
            return '#fed976';
        case 'PRIMARIA':
            return '#edae2f';
        case 'SECUNDARIA': // Agrega aquí la tercera categoría
            return '#c7a051'; // Asigna el color correspondiente a la tercera categoría
        default:
            return '#000000'; // Color por defecto si la categoría no coincide con ninguna de las especificadas
    }
}
function styleRuta (feature){
      return {
        
        weight: 1,
        opacity: 0.5,
        color:getColor(feature.properties.CATEGORIA),
        dashArray: '0',
       
    }
};
